                <li><a href="#"><FontAwesomeIcon size="lg" icon={faGlobe} /></a></li>
                <li><a href="#"><FontAwesomeIcon size="lg" icon={faList} /></a></li>
                <li><a href="#"><FontAwesomeIcon size="lg" icon={faChartBar} /></a></li>
                </ul>
                <div className="filler">

                </div>
            </div>
         );
    }
}

export default Navbar;
